oxy_webhelp_navlinks = {"tocId-d22872e17875":{"topics":[{"title":"Azure SQL native backup capabilities","shortdesc":"<p class=\"shortdesc\">Azure provides native backup solutions for Azure SQL workloads, including         Point-in-Time Retention and Long-Term Retention. While these offer foundational protection,         they have certain limitations.<\/p>","href":"saas\/azr_sql_native_backup_capability_2.html","attributes":{"data-id":"azr_sql_native_backup_capability"},"menu":{"hasChildren":false},"tocID":"azr_sql_native_backup_capability-d22872e17876","topics":[]},{"title":"Azure SQL native versus Rubrik backups","shortdesc":"<p class=\"shortdesc\">A comparative overview of the Azure SQL native backups and Rubrik         backups.<\/p>","href":"saas\/azr_sql_native_vs_rbk_backups_2.html","attributes":{"data-id":"azr_sql_native_vs_rbk_backups"},"menu":{"hasChildren":false},"tocID":"azr_sql_native_vs_rbk_backups-d22872e17887","topics":[]},{"title":"Supported Azure SQL backup and recovery types","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> protects Azure SQL Databases and Managed Instances by supporting         different types of backup and recovery options.<\/p>","href":"saas\/azr_sql_supp_backup_recv_types_2.html","attributes":{"data-id":"azr_sql_supp_backup_recv_types"},"menu":{"hasChildren":false},"tocID":"azr_sql_supp_backup_recv_types-d22872e17898","topics":[]},{"title":"Rubrik backup components for Azure SQL MI","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> protects Azure SQL Managed Instances by taking Rubrik backups         that use several key components: Rubrik Exocompute for data processing, Change Data Capture         to ensure transactional consistency in BACPAC files, the Cloud Storage Layer for efficient         storage, and snapshot immutability for cyber resilience. Rubrik backups offer significant         advantages, including a logical air gap and flexible recovery options.<\/p>","href":"saas\/azr_sql_mi_rbk_backup_components.html","attributes":{"data-id":"azr_sql_mi_rbk_backup_components"},"menu":{"hasChildren":false},"tocID":"azr_sql_mi_rbk_backup_components-d22872e17911","topics":[]},{"title":"Supported datatypes for Azure SQL MI Rubrik backups","shortdesc":"<p class=\"shortdesc\">Information about the datatypes that <span class=\"ph\">RSC<\/span> supports for the Azure SQL         Managed Instance Rubrik backups.<\/p>","href":"saas\/azr_sql_mi_supp_datatypes_rbk_backups.html","attributes":{"data-id":"azr_sql_mi_supp_datatypes_rbk_backups"},"menu":{"hasChildren":false},"tocID":"azr_sql_mi_supp_datatypes_rbk_backups-d22872e17924","topics":[]}]}};